import React, { Component } from 'react';
import sky from './assets/imgs/background/01_Sky.svg';
import ground from './assets/imgs/background/02_Ground.svg';
import sea from './assets/imgs/background/03_Sea.svg';
import sun from './assets/imgs/background/04_a_Sun.svg';
import cloud from './assets/imgs/background/04_b_Cloud.svg';
import './App.css';

class Background extends Component {
  render() {
    return (
      <div>
        <img src={sky}/>
        <img src={sky}/>
        <img src={sky}/>
        <img src={sky}/>
      </div>

    );
  }
}

export default Background;
